    DC  Dear Ms. Hough: In reference to the amendment letter request dated July 23,
    2010, I have corrected all records that reflected the incorrect cycle.  They were
    put in incorrectly but were designated for the General as filed by each one.  The
    contribution for United Food & Commercial Workers was designated for the Primary
    and I contacted them via phone and was given  permission to designate that contribution
    to the General electionn ( A confirmation has been received via email to confirm
    this change and a copy has been mailed to you).  That contribution will show up
    in the next quarterly (October) because redesignating with memo I am required
    to put the date that the redesignation was done (8/23/2010).  The April quarterly
    has been amended to reflect those contributions that were received in March after
    the April Quarterly filing date and the July quarterly has been amended to reflect
